import "./App.scss";
import Header from "./components/header/Header";
import Products from "./components/products/Products";
import { categories, products } from "./helper/data.js";

function App() {
  return (
    <div>
      <Header categories={categories} />
      <Products products={products} />
    </div>
  );
}

export default App;
